import React from 'react';
import {Link, useParams} from 'react-router-dom'
import TrainingSidebar from './TrainingSidebar';
import {useEffect, useState} from 'react'
import axios from 'axios';

const baseUrl = 'http://127.0.0.1:8000/api';

function TrainingDetails(){

    const [trainingData, settrainingData] = useState([]);
    const { training_id } = useParams();
    const { course_id } = useParams();

    console.log(training_id);
    console.log(course_id);


    useEffect(() => {
        try {
        axios.get(baseUrl + "/training-details/" + training_id).then((res) => {
            console.log(res)
            settrainingData(res.data);
        });
        } catch (error) {
        console.log(error);
        }
    }, []);

    return(
        <div className="container-fluid main_container mt-3">
      <div className="row">
        <aside className="col-md-3 ms-5"><TrainingSidebar /></aside>
        <div className="col-md-7">
          <div className="card">
            <h5 className="card-header">My Courses</h5>
            <div className="card-body">
              <table className="table table-bordered">
                <thead>
                  <tr>
                    <th>Course</th>
                    <th>Date</th>
                    <th>Time</th>
                    <th>Meeting Link</th>
                  </tr>
                </thead>
                <tbody>
                    <tr>
                        {trainingData.map((row, index) => { 
                        <>
                            <td>
                                <Link>{row.course.title}</Link>
                            </td>
                            <td>
                                {row.data}
                            </td>
                            <td>
                                time
                            </td>
                            <td>
                                meeting link
                            </td>
                        </>
                        }
                        )}
                    </tr>

                </tbody>
              </table>
            </div>
          </div>
        </div>
      </div>
    </div>
    )
}

export default TrainingDetails;
